// src/pages/ConsultasAgendadasMedico.js

import React from 'react';
import { Table } from 'react-bootstrap';

function ConsultasAgendadasMedico() {
    const consultas = [
        { paciente: 'Paciente 1', data: '2024-11-01', hora: '09:00', motivo: 'Consulta de Rotina' },
        { paciente: 'Paciente 2', data: '2024-11-02', hora: '10:30', motivo: 'Retorno' },
        { paciente: 'Paciente 3', data: '2024-11-03', hora: '14:00', motivo: 'Exame' },
        // Adicione mais consultas conforme necessário
    ];

    return (
        <div>
            <h3>Consultas Agendadas</h3>
            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>Paciente</th>
                        <th>Data</th>
                        <th>Hora</th>
                        <th>Motivo</th>
                    </tr>
                </thead>
                <tbody>
                    {consultas.map((consulta, index) => (
                        <tr key={index}>
                            <td>{consulta.paciente}</td>
                            <td>{consulta.data}</td>
                            <td>{consulta.hora}</td>
                            <td>{consulta.motivo}</td>
                        </tr>
                    ))}
                </tbody>
            </Table>
        </div>
    );
}

export default ConsultasAgendadasMedico;
